import { createRouter, createWebHistory } from 'vue-router'

const routes = [
  {
    path: '/',
    name: 'Home',
    redirect: '/admin-classroom' 
  },
  {
    path: '/admin-classroom',
    name: 'AdminClassroom',
    component: () => import('../views/AdminClassroom.vue')  // 改用动态导入
  },
  {
    path: '/admin-approve',
    name: 'AdminApprove', 
    component: () => import('../views/AdminApprove.vue')
  },
  {
    path: '/admin-library',
    name: 'AdminLibrary',
    component: () => import('../views/AdminLibrary.vue')
  },
  {
    path: '/student-library',
    name: 'StudentLibrary',
    component: () => import('../views/StudentLibrary.vue')
  },
  {
    path: '/tea-stu-library',
    name: 'TeaStuClassroom',
    component: () => import('../views/TeaStuClassroom.vue')
  },
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
